import React from 'react';
import { Link  } from 'react-router-dom';

const Header = () => {
    return (
        <header>
            <h1>Interact with Car Shopping API</h1>
            <nav>
                <Link to={'/'}>Documentation Page</Link>
            </nav>
            <nav>
                <Link to={'/carshoppingapi'}>Car API page</Link>
            </nav>
        </header>
    )
}

export default Header;
